import React, { useState } from 'react';

function App() {

  const [likes, setLikes] = useState(0);
  console.log(likes);
  console.log(setLikes);

  function decriment() {
    setLikes(likes - 1);
  }
  function increment() {
    setLikes(likes + 1);
  }


  return (
    <div className="App">
      <h1>{likes}</h1>
      <button onClick={decriment}>decriment</button>
      <button onClick={increment}>increment</button>

    </div>
  );
}

export default App;
